import { View, Text } from "react-native";
import { GestureDetector } from "react-native-gesture-handler";
import Animated from "react-native-reanimated";

const Block = () => {
    return (
        <View>
            <Text>-</Text>
            <GestureDetector>
                <Animated.View>

                </Animated.View>
            </GestureDetector>
            <Text>+</Text>
        </View>
    )
}

export default Block;
